from typing import List

def next_greatest_letter(letters: List[str], target: str) -> str:
    start = 0
    end = len(letters)

    while start < end:
        mid = start + (end - start) // 2
        if letters[mid] <= target:
            start = mid + 1
        else:
            end = mid

    return letters[start % len(letters)]
